import { reactive } from 'vue'

const config = reactive({
    theme_color: "rgb(0, 163, 82)",
    bg_color: "rgb(0, 163, 82)",
    username: '',
    projects: []
})

const methods = {
    init () {
      let localConfig = JSON.parse(localStorage.getItem('local_config'))
  
      if (localConfig === null) {
        config.projects = [
          { id: 1, nome: 'Barragem', pais: 'Angola', data: '2021-07-10', descricao: 'Construção barragem', imagem: 'data:imagem/jpeg;base64,' },
          { id: 2, nome: 'Barragem', pais: 'Moçambique', data: '2021-07-08', descricao: 'Construção barragem', imagem: 'data:imagem/jpeg;base64,' },
          { id: 3, nome: 'Auto estrada', pais: 'Moçambique', data: '2021-07-08', descricao: 'Construção auto estrada', imagem: 'data:imagem/jpeg;base64,' },
          { id: 4, nome: 'Ponte', pais: 'Moçambique', data: '2021-07-09', descricao: 'Construção ponte', imagem: 'data:image/jpeg;base64,' },
          { id: 5, nome: 'Ponte', pais: 'Moçambique', data: '2021-07-09', descricao: 'Construção ponte', imagem: 'data:image/jpeg;base64,' },
          { id: 6, nome: 'Ponte', pais: 'Moçambique', data: '2021-07-09', descricao: 'Construção ponte', imagem: 'data:image/jpeg;base64,' },
          { id: 7, nome: 'Ponte', pais: 'Moçambique', data: '2021-07-09', descricao: 'Construção ponte', imagem: 'data:image/jpeg;base64,' },
          { id: 8, nome: 'Hospital', pais: 'Angola', data: '2021-07-10', descricao: 'Construção hospital', imagem: 'data:imagem/jpeg;base64,' }
        ]
        localConfig = config

        localStorage.setItem('local_config', JSON.stringify(config))
      }
  
      config.theme_color = localConfig.theme_color
      config.bg_color = localConfig.bg_color
      config.projects = localConfig.projects
      config.username = localConfig.username
    },
    setThemeColor (theme_color) {
      config.theme_color = theme_color
      localStorage.setItem('local_config', JSON.stringify(config))
    },
    setBgColor () {
      config.bg_color = !config.bg_color
      localStorage.setItem('local_config', JSON.stringify(config))
    },
    getProjects () {
      return config.projects.sort((a, b) => a.id - b.id)
    },
    setUsername (username) {
      config.username = username
      localStorage.setItem('local_config', JSON.stringify(config))
    },
    getUsername () {
      return config.username
    },
    saveProject (project) {
      console.log(project)
      config.projects = config.projects.filter(p => p.id !== project.id)

      config.projects.push(project)

      localStorage.setItem('local_config', JSON.stringify(config))
    },
    deleteProject (id) {
      config.projects = config.projects.filter(p => p.id !== id)

      localStorage.setItem('local_config', JSON.stringify(config))
    }
  }

export {
    config,
    methods
}